cypher:
MATCH (o:Organization)
WHERE o.nbrEmployees > 500 AND EXISTS {
  (o)<-[:MENTIONS]-(a:Article)
  WHERE a.sentiment > 0.8
}
RETURN o.name

typeql:
match
  $accenture isa organization, has name "Accenture";
  (parent_org: $accenture, subsidiary_org: $sub) isa subsidiary;
  $sub has name $subName;
  (led_org: $sub, ceo: $ceo) isa ceo_leadership;
  $ceo has name $ceoName;
sort $ceoName asc;
limit 3;
fetch { "ceoName": $ceoName, "subName": $subName };

match
  $o1 isa organization, has name $n1;
  $o2 isa organization, has name $n2;
  $investor has name $inv_name;
  (invested_org: $o1, investor: $investor) isa investment;
  (invested_org: $o2, investor: $investor) isa investment;
  (competitor: $o1, competitor: $o2) isa competition;
limit 3;
fetch { "Org1": $n1, "Org2": $n2, "CommonInvestor": $inv_name };

match
  $o isa organization, has name $org_name;
  $sub isa organization;
  (parent_org: $o, subsidiary_org: $sub) isa subsidiary;
  (located_org: $o, location_city: $city1) isa location;
  (located_org: $sub, location_city: $city2) isa location;
  (located_city: $city1, location_country: $c) isa country_location;
  (located_city: $city2, location_country: $c) isa country_location;
reduce $num_subs = count($sub) within $o, $org_name;
sort $num_subs desc;
limit 3;
fetch { "organization": $org_name, "numberOfSubsidiaries": $num_subs };

match
  $o isa organization, has is_public true, has name $n, has summary $s;
  $c isa industry_category, has industry_category_name "Technology";
  (categorized_org: $o, category: $c) isa categorization;
limit 3;
fetch { "organization": $n, "summary": $s };

match
  $o isa organization, has revenue $r;
  $r > 1000000000.0;
  (competitor: $o, competitor: $c) isa competition;
  $c has name $n;
limit 3;
fetch { "competitor": $n };

match
  $a isa article, has sentiment $s, has title $t, has site_name $sn, has date $d;
  $o isa organization;
  $c isa city, has city_name "Seattle";
  (mentioning_article: $a, mentioned_org: $o) isa mention;
  (located_org: $o, location_city: $c) isa location;
  $s > 0.7;
limit 3;
fetch { "title": $t, "siteName": $sn, "date": $d };

cypher:
MATCH (o1:Organization)-[:HAS_CEO]->(p:Person)
WHERE EXISTS {
  (p)-[:HAS_BOARD_MEMBER]->(o2:Organization)
  WHERE o1 <> o2
}
RETURN o1.name AS organization, p.name AS ceo_and_board_member

typeql:
match
  $o1 isa organization, has name $org_name;
  (led_org: $o1, ceo: $p) isa ceo_leadership;
  $p has name $ceo_name;
  (governed_org: $o2, board_member: $p) isa board_membership;
  not { $o1 is $o2; };
fetch { "organization": $org_name, "ceo_and_board_member": $ceo_name };

match
  $o isa organization, has nbr_employees $e;
  $e > 1000;
  (located_org: $o, location_city: $c) isa location;
  $c has city_name $city;
reduce $numOrgs = count($o) group $city;
sort $numOrgs desc;
limit 3;

match $o isa organization, has is_dissolved false, has name $n, has revenue $r;
sort $r desc;
limit 3;
fetch { "organization": $n, "revenue": $r };

match
  $o isa organization, has name $org_name;
  $sub isa organization, has name "SuccessFactors";
  (parent_org: $o, subsidiary_org: $sub) isa subsidiary;
fetch { "organization": $org_name, "subsidiary": "SuccessFactors" };

match
  $article isa article, has site_name "MrWeb";
  (mentioning_article: $article, mentioned_org: $org) isa mention;
  $org has name $n;
limit 3;
fetch { "organization": $n };

match
  $o isa organization, has name $org_name, has nbr_employees $emp;
  (located_org: $o, location_city: $c) isa location;
  (located_city: $c, location_country: $country) isa country_location;
  $country has country_name "United States of America";
  $emp > 5000;
limit 10;
fetch { "organization": $org_name };

match
  $o isa organization, has name $n;
  (led_org: $o, ceo: $p) isa ceo_leadership;
  $p isa person;
  (mentioning_article: $a, mentioned_org: $o) isa mention;
  $a isa article;
reduce $mentions = count($a) group $n;
sort $mentions desc;
limit 3;

match
  $o isa organization, has revenue $r;
  $r > 500000000;
  (led_org: $o, ceo: $ceo) isa ceo_leadership;
  (parent: $ceo, child: $child) isa parent_child;
  $child has name $child_name;
limit 3;
fetch { "child_name": $child_name };

match
  $p isa person, has name "Julie Spellman Sweet";
  (invested_org: $o, investor: $p) isa investment;
  $o has name $org_name;
fetch { "organization": $org_name };

match
  $c isa chunk, has text $t;
  $t like "%consumer behavior%";
  (parent_article: $a, child_chunk: $c) isa chunk_relation;
  (mentioning_article: $a, mentioned_org: $o) isa mention;
  $o has name $n;
limit 3;
fetch { "organization": $n };

match
  $o isa organization, has name $org_name, has revenue $rev;
  $c isa city, has city_name "Seattle";
  (located_org: $o, location_city: $c) isa location;
  $rev < 1000000000.0;
fetch { "organization": $org_name, "revenue": $rev };

match
  $a isa article, has author "David Correa";
  $o isa organization, has is_dissolved true, has name $n;
  (mentioning_article: $a, mentioned_org: $o) isa mention;
limit 3;
fetch { "organization": $n };

match
  $o isa organization, has is_public true, has name $n, has revenue $r;
  $c isa industry_category, has industry_category_name "Healthcare";
  (categorized_org: $o, category: $c) isa categorization;
sort $r desc;
limit 3;
fetch { "organization": $n };

match
  $o isa organization;
  (mentioning_article: $a1, mentioned_org: $o) isa mention;
  (mentioning_article: $a2, mentioned_org: $o) isa mention;
  (mentioning_article: $a3, mentioned_org: $o) isa mention;
  (mentioning_article: $a4, mentioned_org: $o) isa mention;
  (mentioning_article: $a5, mentioned_org: $o) isa mention;
  (mentioning_article: $a6, mentioned_org: $o) isa mention;
  not { $a1 is $a2; };
  not { $a1 is $a3; };
  not { $a1 is $a4; };
  not { $a1 is $a5; };
  not { $a1 is $a6; };
  not { $a2 is $a3; };
  not { $a2 is $a4; };
  not { $a2 is $a5; };
  not { $a2 is $a6; };
  not { $a3 is $a4; };
  not { $a3 is $a5; };
  not { $a3 is $a6; };
  not { $a4 is $a5; };
  not { $a4 is $a6; };
  not { $a5 is $a6; };
  (ceo: $ceo, led_org: $o) isa ceo_leadership;
  $ceo has name $ceo_name;
limit 3;
fetch { "ceo": $ceo_name };

match
  $a isa article, has title $t;
  (mentioning_article: $a, mentioned_org: $o) isa mention;
  (led_org: $o, ceo: $p) isa ceo_leadership;
  $p has name "Julie Spellman Sweet";
limit 3;
fetch { "article_title": $t };

match
  $o isa organization, has name $org_name;
  $city isa city;
  $country isa country, has country_name "United States of America";
  $p isa person, has name "Julie Spellman Sweet";
  (located_org: $o, location_city: $city) isa location;
  (located_city: $city, location_country: $country) isa country_location;
  (led_org: $o, ceo: $p) isa ceo_leadership;
fetch { "organization": $org_name };

match
  $o isa organization, has name $n;
  $s isa organization, has name "Icon Integration";
  (supplied_org: $o, supplier_org: $s) isa supply;
limit 3;
fetch { "organization": $n };

match
  $a isa article, has title $t;
  (mentioning_article: $a, mentioned_org: $o) isa mention;
  $o isa organization, has nbr_employees $e;
  $e > 50;
limit 3;
fetch { "article_title": $t };

match
  $c isa country, has country_name "Italy";
  (located_city: $city, location_country: $c) isa country_location;
  (located_org: $o, location_city: $city) isa location;
  (governed_org: $o, board_member: $p) isa board_membership;
  $p has name $n;
limit 3;
fetch { "board_member": $n };

match
  $a isa article, has sentiment $s;
  $s < 0.3;
  (mentioning_article: $a, mentioned_org: $o) isa mention;
  $o has name $n;
reduce $mentions = count($a) groupby $n;
sort $mentions desc;
limit 3;

match
  $o isa organization, has nbr_employees $e, has name $n;
  $c isa industry_category, has industry_category_name "Finance";
  (categorized_org: $o, category: $c) isa categorization;
  $e > 1000;
fetch { "organization": $n };

match $o isa organization, has is_public false, has nbr_employees $e, has name $n;
sort $e desc;
limit 3;
fetch { "organization": $n, "employees": $e };

match
  $p isa person, has name "Julie Spellman Sweet";
  (ceo: $p, led_org: $o) isa ceo_leadership;
  $o isa organization, has name $org_name;
  (categorized_org: $o, category: $c) isa categorization;
  $c isa industry_category, has industry_category_name "Technology";
fetch { "organization": $org_name };

match
  $o isa organization, has name $n;
  (ceo: $p, led_org: $o) isa ceo_leadership;
  (mentioning_article: $a, mentioned_org: $o) isa mention;
  $a has sentiment $s;
  $s < 0.3;
limit 3;
fetch { "name": $n };

match
  $i isa person, has name $n;
  $o isa organization, has revenue $r;
  (investor: $i, invested_org: $o) isa investment;
  $r > 500000000;
limit 3;
fetch { "name": $n };

match
  $a isa article, has title $t;
  (mentioning_article: $a, mentioned_org: $o) isa mention;
  (categorized_org: $o, category: $ind) isa categorization;
  $ind has industry_category_name "Healthcare";
limit 3;
fetch { "title": $t };

match
  $o isa organization, has is_public true, has name $n, has summary $s, has revenue $r;
  (located_org: $o, location_city: $c) isa location;
  (located_city: $c, location_country: $country) isa country_location;
  $country has country_name "Italy";
sort $r desc;
limit 3;
fetch { "organization": $n, "summary": $s };

match
  $o isa organization, has name $n;
  (governed_org: $o, board_member: $p) isa board_membership;
  $p isa person;
reduce $org_name = first($n), $board_count = count($p) within $o;
sort $board_count desc;
limit 3;

match
  $o isa organization, has name $org_name, has summary $org_summary;
  $p isa person, has name "Julie Spellman Sweet";
  (led_org: $o, ceo: $p) isa ceo_leadership;
  (located_org: $o, location_city: $c) isa location;
  (located_city: $c, location_country: $country) isa country_location;
  $country has country_name "Italy";
fetch { "name": $org_name, "summary": $org_summary };

match
  $article isa article, has title $t, has article_summary $s, has date $d;
  $org isa organization, has revenue $r;
  $r > 500000000.0;
  (mentioning_article: $article, mentioned_org: $org) isa mention;
  $ceo isa person, has name "Julie Spellman Sweet";
  (led_org: $org, ceo: $ceo) isa ceo_leadership;
limit 3;
fetch { "title": $t, "summary": $s, "date": $d };

match
  $o isa organization, has is_dissolved true, has name $n;
  $a isa article, has sentiment $s;
  (mentioning_article: $a, mentioned_org: $o) isa mention;
reduce $org_name = first($n), $avg_sentiment = mean($s) within $o;
sort $avg_sentiment desc;
limit 3;

match
  $o isa organization, has name $org_name, has revenue $r;
  $r > 1000000000.0;
  (led_org: $o, ceo: $ceo) isa ceo_leadership;
  $ceo isa person, has name $ceo_name;
  (parent_org: $o, subsidiary_org: $sub) isa subsidiary;
limit 3;
fetch { "ceoName": $ceo_name, "orgName": $org_name };

match
  $a isa article, has title $t, has sentiment $s;
  $s < 0.5;
  $o isa organization, has nbr_employees $e, has name $org_name;
  $e > 500;
  (mentioning_article: $a, mentioned_org: $o) isa mention;
limit 3;
fetch { "title": $t, "sentiment": $s, "name": $org_name };

match
  $o isa organization, has name $org_name, has revenue $r;
  $r > 1000000000.0;
  $c isa industry_category, has industry_category_name "Technology";
  (categorized_org: $o, category: $c) isa categorization;
fetch { "organization": $org_name, "revenue": $r };

match
  $o isa organization, has name $org_name, has summary $org_summary;
  $p isa person, has name "Julie Spellman Sweet";
  (led_org: $o, ceo: $p) isa ceo_leadership;
  $c isa city, has city_name "Seattle";
  (located_org: $o, location_city: $c) isa location;
limit 3;
fetch { "name": $org_name, "summary": $org_summary };

match
  $o isa organization, has name $org_name, has summary $org_summary, has revenue $r;
  $p isa person;
  (led_org: $o, ceo: $p) isa ceo_leadership;
  $c isa city, has city_name "New York City";
  (located_org: $o, location_city: $c) isa location;
sort $r desc;
limit 3;
fetch { "organization": $org_name, "summary": $org_summary };

cypher:
MATCH (o:Organization)-[:HAS_CEO]->(p:Person {name: 'Julie Spellman Sweet'})
WHERE EXISTS {
  (o)-[:HAS_SUBSIDIARY]->(:Organization {name: 'Icon Integration'})  
}
RETURN o

typeql:
match
  $o isa organization, has nbr_employees $emp, has name $org_name;
  $emp < 50;
  (invested_org: $o, investor: $investor) isa investment;
  $investor has name $investor_name;
sort $emp asc;
limit 3;
fetch { "investor": $investor_name, "company": $org_name };

match
  $o isa organization, has name $org_name;
  (led_org: $o, ceo: $p) isa ceo_leadership;
  $p isa person;
  (mentioning_article: $a, mentioned_org: $o) isa mention;
  $a isa article, has date $d;
sort $d desc;
limit 3;
fetch { "organization": $org_name, "latest_mention_date": $d };

match
  $o isa organization, has name $org_name, has revenue $rev;
  $rev < 10000000.0;
  (located_org: $o, location_city: $city) isa location;
  $city isa city;
  (located_city: $city, location_country: $country) isa country_location;
  $country isa country, has country_name "United States of America";
fetch { "organization": $org_name, "revenue": $rev };

match
  $o isa organization, has name $org_name, has organization_id $org_id;
  (led_org: $o, ceo: $p) isa ceo_leadership;
  $p isa person, has name "Julie Spellman Sweet";
  (mentioning_article: $a, mentioned_org: $o) isa mention;
  $a isa article, has sentiment $sent;
  $sent > 0.5;
limit 3;
fetch { "name": $org_name, "organization_id": $org_id };

match
  $o1 isa organization, has name $org1_name, has organization_id $org1_id;
  $o2 isa organization, has name $org2_name, has organization_id $org2_id;
  $org1_id != $org2_id;
  (invested_org: $o1, investor: $investor) isa investment;
  (invested_org: $o2, investor: $investor) isa investment;
  $investor has name $investor_name;
  (located_org: $o1, location_city: $city1) isa location;
  (located_city: $city1, location_country: $country1) isa country_location;
  $country1 isa country, has country_name "Italy";
  (located_org: $o2, location_city: $city2) isa location;
  (located_city: $city2, location_country: $country2) isa country_location;
  $country2 isa country, has country_name "Italy";
limit 3;
fetch { "org1": $org1_name, "org2": $org2_name, "investor": $investor_name };

cypher:
MATCH (o:Organization)<-[:MENTIONS]-(a:Article)
WHERE a.sentiment > 0.7 AND EXISTS {
  (o)-[:HAS_CEO]->(p:Person {name: 'Julie Spellman Sweet'})
}
RETURN o.name
LIMIT 3

MATCH (o:Organization)
WHERE o.isPublic = true
  AND EXISTS {
    (o)-[:HAS_CEO]->(p:Person {name: 'Julie Spellman Sweet'})
  }
RETURN o

typeql:
match
  $o isa organization;
  (categorized_org: $o, category: $c) isa categorization;
  $c has industry_category_name $name;
reduce $org_count = count($o), group($name);
sort $org_count desc;
limit 3;
fetch { "category": $name, "organizationCount": $org_count };

match
  $o1 isa organization, has name $n;
  $o2 isa organization;
  (supplier_org: $o1, supplied_org: $o2) isa supply;
  (categorized_org: $o2, category: $c) isa categorization;
  $c isa industry_category, has industry_category_name "technology";
limit 3;
fetch { "supplierName": $n };

match
  $a isa article;
  (mentioning_article: $a, mentioned_org: $o) isa mention;
  $o isa organization;
  (located_org: $o, location_city: $city) isa location;
  $city has city_name $cn;
reduce $mention_count = count($a), group($cn);
sort $mention_count desc;
limit 3;
fetch { "cityName": $cn, "mentionCount": $mention_count };

match
  $o isa organization, has is_public true, has name $org_name;
  (governed_org: $o, board_member: $p) isa board_membership;
  $p has name $member_name;
limit 3;
fetch { "organization": $org_name, "boardMember": $member_name };

match
  $o isa organization, has name $n;
  (parent_org: $o, subsidiary_org: $s) isa subsidiary;
limit 3;
fetch { "parentOrganization": $n };

match
  $o isa organization;
  (located_org: $o, location_city: $city) isa location;
  (located_city: $city, location_country: $country) isa country_location;
  $country has country_name $countryName;
reduce $cityCount = count($city) within $countryName;
sort $cityCount desc;
limit 3;

match
  $o1 isa organization, has name $n1;
  $o2 isa organization, has name $n2;
  (competitor: $o1, competitor: $o2) isa competition;
  (categorized_org: $o1, category: $c) isa categorization;
  $c isa industry_category, has industry_category_name "software";
limit 3;
fetch { "competitor1": $n1, "competitor2": $n2 };

match
  $investor isa organization, has name $n;
  $o isa organization;
  (investor: $investor, invested_org: $o) isa investment;
  $c isa industry_category, has industry_category_name "healthcare";
  (categorized_org: $o, category: $c) isa categorization;
limit 3;
fetch { "investorName": $n };

match
  $p isa person, has name $n;
  (parent: $p, child: $c) isa parent_child;
reduce $children_count = count($c), group($n);
sort $children_count desc;
limit 3;
fetch { "parentName": $n, "childrenCount": $children_count };

match
  $o isa organization, has name $n;
  (board_member: $p, governed_org: $o) isa board_membership;
  $investor isa organization;
  (investor: $investor, invested_org: $o) isa investment;
limit 3;
fetch { "organizationName": $n };

match
  $o isa organization, has is_public true;
  (located_org: $o, location_city: $c) isa location;
  $c has city_name $cn;
fetch { "cityName": $cn };

match
  $p isa person, has name $ceo_name;
  $o isa organization, has name $org_name;
  $c isa industry_category, has industry_category_name "manufacturing";
  (ceo: $p, led_org: $o) isa ceo_leadership;
  (categorized_org: $o, category: $c) isa categorization;
limit 3;
fetch { "ceoName": $ceo_name, "organizationName": $org_name };

match
  $a isa article, has sentiment $s;
  $s > 0.5;
  (mentioning_article: $a, mentioned_org: $o) isa mention;
  $o has name $n;
limit 3;
fetch { "organizationName": $n };

match
  $o isa organization, has revenue $r;
  $r > 10000000000;
  (categorized_org: $o, category: $c) isa categorization;
  $c has industry_category_name $cat_name;
fetch { "category": $cat_name };

match
  $p isa person, has summary $s;
  (ceo: $p, led_org: $o) isa ceo_leadership;
  $o has name $n;
  $s like "%innovation%";
fetch { "organizationName": $n };

match
  $investor isa organization;
  $o isa organization, has name $org_name;
  (investor: $investor, invested_org: $o) isa investment;
reduce $investor_count = count($investor) group by $org_name;
sort $investor_count desc;
limit 3;
fetch { "organizationName": $org_name, "investorCount": $investor_count };

match
  $a isa article;
  $o isa organization, has name $n;
  (mentioning_article: $a, mentioned_org: $o) isa mention;
reduce $count = count($a), group($n);
$count >= 5;
limit 3;
fetch { "organizationName": $n };

match $o isa organization, has is_dissolved true, has name $n;
limit 3;
fetch { "organizationName": $n };

match
  $a isa article;
  (mentioning_article: $a, mentioned_org: $o) isa mention;
  $o isa organization;
  (categorized_org: $o, category: $c) isa categorization;
  $c isa industry_category, has industry_category_name "finance";
  (located_org: $o, location_city: $city) isa location;
  (located_city: $city, location_country: $country) isa country_location;
  $country has country_name $countryName;
reduce $mentionCount = count($a) group by $countryName;
sort $mentionCount desc;
limit 3;
fetch { "countryName": $countryName, "mentionCount": $mentionCount };

match
  $o isa organization, has name $n;
  (parent_org: $o, subsidiary_org: $s) isa subsidiary;
  (investor: $investor, invested_org: $o) isa investment;
fetch { "organizationName": $n };

match
  $o1 isa organization, has name $org_name;
  (located_org: $o1, location_city: $city1) isa location;
  (located_city: $city1, location_country: $country1) isa country_location;
  $country1 has country_name $home_country;
  (parent_org: $o1, subsidiary_org: $o2) isa subsidiary;
  $o2 has name $sub_name;
  (located_org: $o2, location_city: $city2) isa location;
  (located_city: $city2, location_country: $country2) isa country_location;
  $country2 has country_name $sub_country;
  not { $country1 is $country2; };
limit 5;
